import CoreFormsEnum, { getFormName } from '@orchesty/nodejs-sdk/dist/lib/Application/Base/CoreFormsEnum';
import { ApplicationInstall } from '@orchesty/nodejs-sdk/dist/lib/Application/Database/ApplicationInstall';
import Field from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/Field';
import FieldType from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/FieldType';
import Form from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/Form';
import FormStack from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/FormStack';
import WebhookSubscription from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Webhook/WebhookSubscription';
import { ACCESS_TOKEN } from '@orchesty/nodejs-sdk/dist/lib/Authorization/Provider/OAuth2/OAuth2Provider';
import { TOKEN } from '@orchesty/nodejs-sdk/dist/lib/Authorization/Type/Basic/ABasicApplication';
import AOAuth2Application from '@orchesty/nodejs-sdk/dist/lib/Authorization/Type/OAuth2/AOAuth2Application';
import { CLIENT_ID, CLIENT_SECRET } from '@orchesty/nodejs-sdk/dist/lib/Authorization/Type/OAuth2/IOAuth2Application';
import RequestDto from '@orchesty/nodejs-sdk/dist/lib/Transport/Curl/RequestDto';
import { HttpMethods } from '@orchesty/nodejs-sdk/dist/lib/Transport/HttpMethods';
import AProcessDto from '@orchesty/nodejs-sdk/dist/lib/Utils/AProcessDto';
import { CommonHeaders, JSON_TYPE } from '@orchesty/nodejs-sdk/dist/lib/Utils/Headers';

export const NAME = 'outlook';
export const TENANT_ID = 'tenant-id';

export default class OutlookApplication extends AOAuth2Application {

    public getName(): string {
        return NAME;
    }

    public getPublicName(): string {
        return 'Outlook';
    }

    public getDescription(): string {
        return 'Email and calendar, together in one place - send, receive, and manage your email. Use Outlookâ€™s built-in calendar to keep track of appointments and events.';
    }

    public getFormStack(): FormStack {
        const form = new Form(CoreFormsEnum.AUTHORIZATION_FORM, getFormName(CoreFormsEnum.AUTHORIZATION_FORM))
            .addField(new Field(FieldType.TEXT, CLIENT_ID, 'Client id', null, true))
            .addField(new Field(FieldType.TEXT, CLIENT_SECRET, 'Client secret', null, true))
            .addField(new Field(FieldType.TEXT, TENANT_ID, 'Tenant id', null, true));

        return new FormStack().addForm(form);
    }

    public getRequestDto(
        dto: AProcessDto,
        applicationInstall: ApplicationInstall,
        method: HttpMethods,
        _url?: string,
        data?: unknown,
    ): RequestDto {
        const settings = applicationInstall.getSettings();
        const token = settings[CoreFormsEnum.AUTHORIZATION_FORM][TOKEN][ACCESS_TOKEN];
        const url = `https://graph.microsoft.com/v1.0${_url}`;
        const request = new RequestDto(url, method, dto);
        request.setHeaders({
            [CommonHeaders.CONTENT_TYPE]: JSON_TYPE,
            [CommonHeaders.ACCEPT]: JSON_TYPE,
            [CommonHeaders.AUTHORIZATION]: `Bearer ${token}`,
        });

        if (data) {
            request.setJsonBody(data);
        }

        return request;
    }

    // This URL is dynamically replaced in getProviderCustomOptions method
    public getAuthUrl(): string {
        return 'https://login.microsoftonline.com/{tenantId}/oauth2/v2.0/authorize';
    }

    // eslint-disable-next-line @typescript-eslint/no-unused-vars
    public getScopes(applicationInstall: ApplicationInstall): string[] {
        return ['Calendars.Read Calendars.Read.Shared Calendars.ReadBasic Calendars.ReadWrite Calendars.ReadWrite.Shared User.Read offline_access'];
    }

    // This URL is dynamically replaced in getProviderCustomOptions method
    public getTokenUrl(): string {
        return 'https://login.microsoftonline.com/{tenantId}/oauth2/v2.0/token';
    }

    public syncNotificationCallback(req: Request): Response | null {
        const url = new URL(req.url).searchParams;
        const validationToken = url.get('validationToken');

        if (validationToken) {
            const resp = new Response(validationToken);
            resp.headers.set('Content-Type', 'text/plain');

            return resp;
        }

        return null;
    }

    public getWebhookSubscriptions(): WebhookSubscription[] {
        return [];
    }

    public getLogo(): string {
        return 'data:image/svg+xml;base64,';
    }

    protected getProviderCustomOptions(applicationInstall: ApplicationInstall): Record<string, unknown> {
        const tenantId = applicationInstall.getSettings()[CoreFormsEnum.AUTHORIZATION_FORM][TENANT_ID];
        const authorizeUrl = new URL(this.getAuthUrl().replace('{tenantId}', tenantId));
        const tokenUrl = new URL(this.getTokenUrl().replace('{tenantId}', tenantId));

        return {
            auth: {
                authorizeHost: authorizeUrl.origin,
                authorizePath: authorizeUrl.pathname,
                tokenHost: tokenUrl.origin,
                tokenPath: tokenUrl.pathname,
            },
            options: {
                authorizationMethod: 'body',
            },
        };
    }

}
